	return (
		<div className="App">
			<header className="Header">
				<Navbar></Navbar>
				<Main style={{ backgroundColor: red }}></Main>
			</header>
			<footer>
				<Footer></Footer>
			</footer>
		</div>
	);
}

export default App;
